import React, { useEffect, useState } from 'react';
import './App.css';

const App = () => {
  const [profile, setProfile] = useState(null);
  const [photoUrl, setPhotoUrl] = useState(null);
  const [scheduleData, setScheduleData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [isDescriptionOpen, setIsDescriptionOpen] = useState(false);

  useEffect(() => {
    const fetchProfileData = async () => {
      setLoading(true);
      setError(null);

      const token = localStorage.getItem('token');
      if (!token) {
        setError('Нет токена авторизации');
        setLoading(false);
        return;
      }

      try {
        // Запрос на получение данных о профиле
        const response = await fetch('http://192.168.1.66:8000/auth/profile', {
          method: 'GET',
          headers: {
            'Authorization': `Bearer ${token}`,
            'Content-Type': 'application/json',
          },
        });

        if (!response.ok) {
          throw new Error(`Ошибка загрузки профиля: ${response.status}`);
        }

        const data = await response.json();
        setProfile(data.user);
        setScheduleData(data.work_days);

        const userId = data.user.id;

        // Запрос на получение фото
        const photoUrl = userId ? `http://192.168.1.66:8000/files/employer/${userId}/get-photo` : null;
        if (photoUrl) {
          const photoResponse = await fetch(photoUrl, {
            method: 'GET',
            headers: { 'Authorization': `Bearer ${token}` },
          });

          if (photoResponse.ok) {
            const photoData = await photoResponse.json();
            if (photoData.status === 'success' && photoData.file_url) {
              setPhotoUrl(photoData.file_url.url);
            } else {
              console.log('Фото не найдено');
            }
          } else {
            throw new Error('Ошибка загрузки фото');
          }
        }
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchProfileData();
  }, []);

  return (
    <div className="profile-container">
      <div className="profile-info">
        {loading ? (
          <p>Загрузка...</p>
        ) : error ? (
          <p className="error">{error}</p>
        ) : profile ? (
          <>
            <img src={photoUrl || ''} alt="Фото профиля" className="profile-photo" />
            <div className="profile-details">
              <h1>{profile.fio}</h1>
              <h2>{profile.work_type}</h2>
              <p>{profile.description}</p>

              {profile.description && (
                <div className="profile-description">
                  <button
                    className="toggle-description"
                    onClick={() => setIsDescriptionOpen(!isDescriptionOpen)}
                  >
                    {isDescriptionOpen ? 'Скрыть описание' : 'Показать описание'}
                  </button>
                  {isDescriptionOpen && <p className="description-text">{profile.description}</p>}
                </div>
              )}
            </div>
          </>
        ) : (
          <p>Нет данных</p>
        )}
      </div>

      <div className="schedule-section">
        <h2>Расписание</h2>
        <div className="schedule-cards">
          {scheduleData.length > 0 ? (
            scheduleData.map((item, index) => (
              <div key={index} className="schedule-card">
                <div className="date">{new Date(item.date).toLocaleDateString('ru-RU')}</div>
                <div className={`status-indicator ${item.isWorking ? 'status-working' : 'status-not-working'}`}>
                  {item.isWorking ? 'Работает' : 'Не работает'}
                </div>
              </div>
            ))
          ) : (
            <p>Нет данных о рабочем расписании</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default App;
